בקשת רשות ערעור על
  פסק דינו של בית המשפט המחוזי מרכז-לוד מיום 13.11.2022 בע"א 63943-07-21
  שניתן על-ידי כבוד השופטות ע' כהן, י' רוטנברג, מ' בן-ארי;

גם
זו הפעם ניתנת ארכה למשיב להגשת תגובה מקדמית לעתירה ולבקשה לצו ביניים, עד ליום 14.2.2023;
ויצוין כי לא נעלמה מעיני התנגדות באת-כוח העותרים לארכה המבוקשת.
